import React from 'react';
import automative from './slide/automative.jpg';
import carpenter from './slide/carpenter.jpg';
import cleaner from './slide/cleaner.jpg';
import electrician from './slide/electrician.jpg';
import mechanics from './slide/mechanics.jpg';
import painter from './slide/painter.jfif';
import plumber from './slide/plumber.jpg';
import ready from './slide/ready.jpg';
import we from './slide/we.png';
import welder from './slide/welder.jpg';


const SlideImg = () => {
    return (
        <div id="carouselExampleSlidesOnly" class="carousel slide" data-ride="carousel">
            <div class="carousel-inner">
                <div class="carousel-item active">
                    <img class="d-block w-100" src={ready} alt="First slide" />
                </div>
                <div class="carousel-item">
                    <img class="d-block w-100" src={automative} alt="Second slide" />
                </div>
                <div class="carousel-item">
                    <img class="d-block w-100" src={carpenter} alt="Third slide" />
                </div>
                <div class="carousel-item">
                    <img class="d-block w-100" src={cleaner} alt="Third slide" />
                </div>
                <div class="carousel-item">
                    <img class="d-block w-100" src={electrician} alt="Third slide" />
                </div>
                <div class="carousel-item">
                    <img class="d-block w-100" src={mechanics} alt="Third slide" />
                </div>
                <div class="carousel-item">
                    <img class="d-block w-100" src={painter} alt="Third slide" />
                </div>
                <div class="carousel-item">
                    <img class="d-block w-100" src={plumber} alt="Third slide" />
                </div>
                <div class="carousel-item">
                    <img class="d-block w-100" src={we} alt="Third slide" />
                </div>
                <div class="carousel-item">
                    <img class="d-block w-100" src={welder} alt="Third slide" />
                </div>
            </div>
        </div>
    )
}
export default SlideImg;
